package net.shibboleth.idp.admin.impl;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.ObjectInputStream;
import java.io.ObjectStreamClass;
import java.util.Base64;

public class Test {

	public static void main(String[] args) throws IOException, ClassNotFoundException {
		String base64Serialized = "";;
		byte[] serializedData = Base64.getDecoder().decode(base64Serialized);
		
//		List.of(new Object[] {null, null, null});
		
		ObjectInputStream ois = new DecompressibleInputStream(new ByteArrayInputStream(serializedData));
		Object result = ois.readObject();
		System.out.println(result);
	}

	// Skip serialVersionUID identifiers difference
	public static class DecompressibleInputStream extends ObjectInputStream {

	    public DecompressibleInputStream(InputStream in) throws IOException {
	        super(in);
	    }
	    
	    @Override
	    protected ObjectStreamClass readClassDescriptor() throws IOException, ClassNotFoundException {
	        ObjectStreamClass resultClassDescriptor = super.readClassDescriptor(); // initially streams descriptor
	        Class localClass; // the class in the local JVM that this descriptor represents.
	        try {
	            localClass = Class.forName(resultClassDescriptor.getName()); 
	        } catch (ClassNotFoundException e) {
	            return resultClassDescriptor;
	        }
	        ObjectStreamClass localClassDescriptor = ObjectStreamClass.lookup(localClass);
	        if (localClassDescriptor != null) { // only if class implements serializable
	            final long localSUID = localClassDescriptor.getSerialVersionUID();
	            final long streamSUID = resultClassDescriptor.getSerialVersionUID();
	            if (streamSUID != localSUID) { // check for serialVersionUID mismatch.
	                final StringBuffer s = new StringBuffer("Overriding serialized class version mismatch: ");
	                s.append("local serialVersionUID = ").append(localSUID);
	                s.append(" stream serialVersionUID = ").append(streamSUID);
	                resultClassDescriptor = localClassDescriptor; // Use local class descriptor for deserialization
	            }
	        }
	        return resultClassDescriptor;
	    }
	} 
}
